player.setCamera( this );

this.far = 2000
var status = -1
window.addEventListener('keydown',function(e) {
		if(e.key == "a") {		// View all scope
			status = 1

		}
		if(e.key == "b") {		// View as before
			status = 0
		}
		if(e.key == "c") {
			status = 100
		}
		if(e.key == "d") {
			status = 101
		}
	if(e.key == "e") {
			status = 102
		}
	if(e.key == "f") {
			status = 103
		}
	if(e.key == "g") {
			status = 104
		}
	}
);

function update( event ) {
	//this.position.x = Math.abs(Math.cos(event.time * 0.0001) * 100) +200;

	if(status == 1)
	{
		console.log("Got keydown as 'a' - view all");
		this.position.x = 0;
		this.position.z = 250;
		this.position.y = 900;
		this.rotation.x = -90;
		this.lookAt( scene.position );

	}
	else if(status == 0)
	{
		console.log("Got keydown as 'b' - view before");
		this.position.x = 0;
		this.position.y = Math.abs(Math.sin(event.time * 0.0001) * 750);
		this.position.z = 200;
		this.rotation.x = -60;
		this.lookAt( scene.position );

	}
	else if(status == 100)
	{
		console.log("Got keydown as 'c' - view outer");
		this.position.x = 881;
		this.position.y = 10;
		this.position.z = -195;
		this.rotation.x = 177.57
		this.rotation.z = -177.46
		this.lookAt( scene.position );

	}
	else if(status == 101)
	{
		console.log("Got keydown as 'd' - view middle");
		this.position.x = 385;
		this.position.y = 140;
		this.position.z = -99;
		this.rotation.x = 67
		this.rotation.z = 100
		this.lookAt( scene.position );

	}
	else if(status == 102)
	{
		console.log("Got keydown as 'e' - view inner");
		this.position.x = 230
		this.position.y = 14;
		this.position.z = 137;
		this.rotation.x = -6
		this.rotation.z = 5
		this.lookAt( scene.position );

	}
	else if(status == 103)
	{
		console.log("Got keydown as 'e' - view inner");
		this.position.x = Math.sin(event.time * 0.0001) * 220
		this.position.y = 14;
		this.position.z = Math.cos(event.time * 0.0001) * 220
		this.rotation.x = -6
		this.rotation.z = 5
		this.lookAt( scene.position );

	}
	else if(status == 104)
	{
		console.log("Got keydown as 'e' - view inner");
		this.position.x = Math.sin(event.time * 0.0002) * 880
		this.position.z = Math.cos(event.time * 0.0002) * 880
		this.position.y = 50;
		this.rotation.x = 177.57
		this.rotation.z = -177.46
		this.lookAt( scene.position );

	}
	else
	{
	}


	//this.lookAt([0,0,0])
}

